<script id="csdraw" type="text/x-cindyscript">
drawimage((7,-2),"image-1.png",scale->3);

m(a,b,c,d,l):=Transpose([cross(a,c)])*[cross(b,d)]
               -l*(Transpose([cross(a,d)])*[cross(b,c)]);


sq(a,p,q):=-p/(a*2)-Sqrt(p^2/(4*a^2)-q/a);

match(a,b,c,d,w,x,y,z):=(
  cr1=crossratio(a,b,c,d);
  mm=m(w,x,y,z,cr1);
  p=(sq(mm_1_1,mm_1_2+mm_2_1,mm_2_2),1,0);
  (sq(mm_1_1,mm_1_2+mm_2_1,mm_2_2),1,0);
);

S.homog=match(A,B,C,D, A',B',C',D');
O.homog=match(A,B,C,E, A',B',C',E');
P.homog=match(A,B,D,E, A',B',D',E');
Q.homog=match(A,C,D,E, A',C',D',E');
R.homog=match(B,C,D,E, B',C',D',E');


;
</script>
